    handleClick = () => {
        let self = this;
        console.log("test button clicked");
        self.props.toggleMap("Map");
    }

    render() {
        return ( 
        	<div>
        		<div>
	            	<button onClick = {this.handleClick} position= 'absolute' top= "40px" >
	            	Switch 
	            	</button> 
	            </div>
	            <div>
	            	<PannellumReact />
	            </div>
            </div>
        );
    }
}

export default ControllerButton;
